import './App.css';
import Students from './component/ilst_of_studentes';
import { useState,useEffect } from 'react';


function App() {

  const [message, setMessage] = useState("");
  fetch("http://localhost:8000/api/students")
  .then((res) => res.json())
  .then((data) => setStudents(data));

  useEffect(() => {
    fetch("http://localhost:8000/message/a")
      .then((res) => res.json())
      .then((data) => setMessage(data.sos));
  }, []);


  return (
    <div className="App">
    <h1>{message}</h1>
    <Students/>
    </div>
  );
}

export default App;
